import React from 'react';
const Note=(props)=>{
    const {title,body}=props.note;
    return(
        <div className="item">
            <div className="content">
                <div className="HeaderNote">{title}</div>
                <div className="description">{body}</div>
            </div>
        </div>
    )
};
export default Note;
